import React from 'react';

function BlogPage() {

const carList = [
  { brand:"BMW", color:"Red"  },
  { brand:"Ford", color:"Blue"  },
  { brand:"Tesla", color:"Green"  },
]

  return (
    <div>
      <h1>Blog Page</h1>
      <ul>
        {carList.map((carInfo)=><li key={carInfo.brand}>{carInfo.brand}  {carInfo.color} </li>)}

      </ul>

      {carList.filter((carInfo)=>carInfo.brand !== 'BMW')}


    </div>
  );
}

export default BlogPage;
